const EASCard = () => {
    return (
        <div>
            <iframe width="850" height="445" src="https://www.youtube.com/embed/2SfSUjxNHtE" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen title="Why You Should Subscribe"></iframe>
        </div>
    );

}

export default EASCard;
